window.bookSummaryJSON = "<p><b>Two hundred years ago, aliens invaded Earth. A violent war followed. The enemy won. Some of us escaped, most of us didn’t.</b></p> <p>On Proxima they flourished - the invasion forgotten. On Earth we floundered - the horror began.</p> <p>Their world is advanced, peaceful, and secure. Our world is broken, savage, and overrun.</p> <p>A new invasion is coming. A hunger that has swallowed half the universe.</p> <p>They don’t care which planet we live on. They want to end us all. But where there is life, there is hope. And where there is hope, there are heroes.</p> <p>Sheriff. Marine. Pilot. Engineer. Centurion. Clone. This time, vengeance will be ours.</p>"; 
